INSERT INTO wrestlers (name, birth_date, debut_date, gender,height, weight, billed_from, cagematch_page, recommended_match, bio, image) 
VALUES ('Orange Cassidy', '05-04-1984', '03-13-2004', 'male', 178, 73, 'Wherever', 'https://www.cagematch.net/?id=2&nr=2813', 'https://www.youtube.com/watch?v=A32sT1c-btU', 'James Cipperly (born May 4, 1984), better known by his ring name Orange Cassidy, is an American professional wrestler and wrestling trainer. He is currently signed to All Elite Wrestling (AEW), where he is the current and longest reigning AEW All-Atlantic Champion in his first reign. Prior to signing with AEW, he had previously performed for the Chikara promotion as the luchador enmascarado (masked professional wrestler), Fire Ant. Fire Ant was part of the Colony stable, which won the Campeonatos de Parejas once and Chikara''s'' premier King of Trios tournament twice. During his time in Chikara, he also appeared unmasked as a member of The Gentleman''s'' Club faction, alongside Chuck Taylor and Drew Gulak, and was a trainer at the promotion''s'' Wrestle Factory school. He also wrestled prominently on the independent circuit from 2004 to 2019.', 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/b473aec9-5340-4f82-90cf-f9e45884d7f1/dffv8jl-af14b33e-faac-408a-a45e-e7944767142b.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..OyUEjZzcRm3ozqJ9Y7FS4MG9PIwtRw3dsL0rU3PRzX0'),
('Kris Statlander', '08-07-1996', '11-2016', 'female', 173, 65, 'Long Island, New York', 'https://www.cagematch.net/?id=2&nr=20328&gimmick=Kris+Statlander', 'https://www.youtube.com/watch?v=QtdYdhrLXHM', 'Kristen Stadtlander (born August 7, 1995) is an American professional wrestler, better known by the ring name Kris Statlander. She is currently signed to All Elite Wrestling, and has also performed on the independent circuit. She is currently inactive due to suffering a knee injury.', 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/b473aec9-5340-4f82-90cf-f9e45884d7f1/df5tt99-7585a116-55c0-4eb6-8e40-509f2e81bb5a.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..pqaEsfPGNKjXeka-N2WiqPbqoy_hMXdy5COkCaKk6p0'),
('Willow Nightingale', '01-25-1994', '02-27-2015', 'female', 168, 83, 'Long Island, New York', 'https://www.cagematch.net/?id=2&nr=17272&gimmick=Willow+Nightingale', 'https://www.youtube.com/watch?v=0hhDCFOGyFE', 'Danielle Paultre (born January 25, 1994), better known by the ring-name Willow Nightingale, is an American professional wrestler currently signed to All Elite Wrestling (AEW). She is best known for her tenures with Ring of Honor and Shimmer Women Athletes.','https://preview.redd.it/for-those-that-care-to-download-at-least-a-good-render-of-v0-vho4fz3kd2x91.png?auto=webp&s=3e670e3141fc7bfa8010219d420357d8a8d9bdee'),
('Wheeler Yuta', '10-26-1996', '2014', 'male', 183, 86, 'Philadelphia, Pennsylvania', 'https://www.cagematch.net/?id=2&nr=19733&gimmick=Wheeler+YUTA', 'https://www.youtube.com/watch?v=CmFKx4oWuZk', 'Paul Gruber (born October 26, 1996), is an American professional wrestler better known by his ring name Wheeler Yuta (sometimes stylized as Wheeler YUTA). He is currently signed to All Elite Wrestling (AEW), where he is the current ROH Pure Champion in his record-setting second reign. He is a member of the Blackpool Combat Club stable, and in addition to appearing for AEW, he also makes appearances in Ring of Honor (ROH), and New Japan Pro-Wrestling (NJPW), where he was formerly a member of Chaos.', 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/b473aec9-5340-4f82-90cf-f9e45884d7f1/df58b1a-a3d3e222-5711-4aac-b6d1-d860f96fc320.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..wEwZ3Mmufb5-1XGBHlv2WXLHHnbeqM33yMQAwptavpY'),
('Konosuke Takeshita', '05-29-1995', '08-18-2012', 'male', 187, 105, 'Osaka, Japan', 'https://www.cagematch.net/?id=2&nr=13073&gimmick=Konosuke+Takeshita', 'https://www.youtube.com/watch?v=gDnnZw65JTk', 'Konosuke Takeshita (竹下幸之介, Takeshita Kōnosuke, born May 29, 1995) is a Japanese professional wrestler currently signed to both All Elite Wrestling (AEW) in the United States and DDT Pro-Wrestling (DDT) in Japan. Takeshita was named the Rookie of the Year by Tokyo Sports in 2013 and is the youngest KO-D Openweight Champion in history, having won the title on his 21st birthday. In DDT, he has also held the KO-D Tag Team Championship, the KO-D 6-Man Tag Team Championship and the Ironman Heavymetalweight Championship. Takeshita signed with AEW in November 2022, after a successful tour of the United States earlier that year.', 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/b473aec9-5340-4f82-90cf-f9e45884d7f1/df92v5g-b24d7969-c9a2-47b5-8680-77e051a4cd9b.png/v1/fill/w_837,h_955,strp/konosuke_takeshita_aew_dynamite_render_2022_by_podwinski_df92v5g-pre.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..lpvcMKDwjRRtC7hhXM852vtGype3u6tJgTNMnkaMNeI'),
('Naomi', '11-30-1987', '08-2009', 'female', 165, 125, 'Sanford, Florida', 'https://www.cagematch.net/?id=2&nr=8819&gimmick=Naomi', 'https://www.youtube.com/watch?v=dETmVjXsvQM', 'Trinity Fatu (born November 30, 1987) is an American professional wrestler and dancer. She is currently signed to WWE, where she performs under the ring name Naomi. In August 2009, Naomi signed with World Wrestling Entertainment (WWE) and was assigned to its past developmental territory Florida Championship Wrestling (FCW), where she was the inaugural FCW Divas Champion. In August 2010, she competed in the all-female third season of NXT, where she came in second place. In January 2012, she made her main roster debut alongside Cameron, forming The Funkadactyls. Since July 2013, Naomi has appeared as one of the main cast members of the reality television series Total Divas. In February 2017, Naomi won the WWE SmackDown Women''s'' Championship at the Elimination Chamber event, becoming the first African-American woman to capture the title. She would then become the inaugural winner of the WrestleMania Women''s'' Battle Royal at WrestleMania 34 the following year and the WWE Women''s'' Tag Team Champion alongside Sasha Banks at WrestleMania 38 in 2022.', 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/24096bd6-5618-4ef1-90dc-62705654a973/deeh9px-47ec0f89-f568-45db-b8e2-607c248ce594.png/v1/fill/w_743,h_1075,strp/wwe_naomi_new_profile_render_2021_by_berkaycan_deeh9px-pre.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..cHUk8evEi6j54kPChhYyV6MErmuYjxCYVV-n1Cb8AH0');


